import React from 'react';

function Home() {
    return (
        <div className="text-center py-20">
            <h1 className="text-4xl font-bold">Welcome To Humming Bird Consulting!</h1>
            <p className="text-gray-700 mt-4">Helping Startups Soar To Success!</p>
        </div>
    );
}

export default Home;
